            $salida->cantidad = $pedido['cantidad'];
            $salida->numero_anual = $pedido['numero_anual'];
            $salida->anio = 2025;
            $salida->id_articulo = $pedido['id_articulo'];
            $salida->id_personal = $pedido['id_personal'];
            $salida->created_at =  Carbon::createFromFormat('d/m/Y', '17/07/2025')->format('d-m-Y');
            $salida->updated_at =  Carbon::createFromFormat('d/m/Y', '17/07/2025')->format('d-m-Y');
            $salida->save();

            $entradas = Entradas::where('id_articulo', $pedido['id_articulo'])
                ->where('restante', '>', 0)->where('anio', 2025)
                ->orderBy('fecha', 'asc')
                ->get();

            $satisfecho = $pedido['cantidad'];

            foreach ($entradas as $entrada) {
                if ($satisfecho <= 0) break;

                $usar = min($entrada->restante, $satisfecho);

                Movimientos::create([
                    'id_salida' => $salida->id,
                    'id_entrada' => $entrada->id,
                    'cantidad_utilizada' => $usar,
                    'precio_unitario' => $entrada->precio_unitario,
                ]);

                $entrada->restante -= $usar;
                $entrada->save();

                $satisfecho -= $usar;
            }
        }

